public class loopdemo {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		int counter = 1;

		while (counter <= 10) {

			System.out.println(counter);
			
			counter = counter + 1;
		}
		
		System.out.println(counter);
	}

}
